import React, { Component } from 'react';

import './Jiujitsu.css';
class Jiujitsu extends Component {
    render() {
        return (
            <div className="JiujitsuStyle">
                <h2>formiga</h2>
                <p>noun</p>
                <p>means "ant" in Portugese</p>
            </div>
        )
    }
}

export default Jiujitsu;
